// Results.js
const Results = () => {
    return (
        <div>
            <p>Date</p>
            <p>New Infections</p>
            <p>Total Infections to date</p>
            <p>New Recoveries</p>
            <p>Total Recoveries to date</p>
        </div>
    );
};
